import React from 'react';
// import './Skills.css';

const Skills = () => {
  return (
    <section id="skills">
      <h1>My Skills</h1>
                <ul>
                    <li>HTML</li>
                    <li>CSS</li>
                    <li>JavaScript</li>
                    <li>C++</li>
                    <li>Coding</li>
                    <li>Nodejs</li>
                    <li>React</li>
                    <li>Mongo</li>
                    <li>TypeScript</li>
                </ul>
    </section>
  );
};

export default Skills;
